import React from "react";
import "./App.css";

import QuoteBox from "./Components/QuoteBox";
import Footer from "./Components/Footer";

class App extends React.Component {
  render() {
    return (
      <div>
        <div className="App">
          <QuoteBox />
        </div>
        <Footer />
      </div>
    );
  }
}

export default App;
